void Com_MainFunction(sint64 period)
{
    if (BM_ADAS_CAN_22_IDC_L2__CreditCountersAvailable() > 0) 
    {
        /* Trigger Tx Function */
        Com_MainFunctionTx(period);
    }

    /* Trigger Rx Function */
    Com_MainFunctionRx();

 
    /* Update our time */
    currentTime += period;
}

